import React from 'react';
import './App.css';
import Navbar from './components/Navbar';
import Activities from './components/Activities';
import Rewards from './components/Rewards';
import { Router, Routes, Route } from "react-router-dom";

function App() {

  return (
    <>
<Router>
    <Navbar title="Text Utils" aboutus="About Us"/>
    <div className="container my-3">
    <Routes>
      <Route path="/aboutus" element={<About accor="about us"/>} />
      <Route path="/" element={<TextForm heading="Enter your Text Here!" formlabel="write something" />} />
    </Routes>
    </div>
    </Router>

     <Router>
        <Navbar name="Name: Akshata Dudhane" dob="DOB: 04/05/2001" tier="Tier: GOLD"/>
        <div>
          <Routes>
          <Route path="/activities" element={<Activities />} />
          <Route path="/rewards" element={<Rewards />} />
      </Routes>
        </div>
      </Router>

    </>
  );
}

export default App;
